import { Component } from "react";

class CardList extends Component{
     render(){
        console.log(this.props)
        return(<div>
            {this.props.filteredMonsters.map((monster)=>{ return <div key={monster.id}><h1>{monster.name}</h1></div>;})}
        </div>)
     }
}  

export default CardList;
